import { makeAutoObservable } from "mobx";
// import * as CustomerService from 'Services/CustomerService';

class TimerStore {
  totalCount = 0;

  constructor(root) {
    this.root = root;
    makeAutoObservable(this);
  }
}
export default TimerStore;
